// Executar uma soma  e multiplicacao simples
function somarEdobrar(primeiro, segundo) {
    let resultado = primeiro + segundo;
    resultado = resultado*2;
    return resultado;
}

// Executar uma leitura de arquivo com Promise
function lerArquivo(nomeArquivo) {
    return new Promise((resolve, reject) => {
        fs.readFile(nomeArquivo, (err, data) => {
            if (err) {
                reject(err);
            } else {
                resolve(data.toString());
            }
        });
    });
}

